import './App.css';

const CalcDisplay = () => (
  <div className="calc__display">
    <input type="text" />
  </div>
)

const CalcButton = ({ text }) => (
  <div className="calc__button">
    <button>{text}</button>
  </div>
);

const Calculator = () => (
  <div className="calc">
    <CalcDisplay />
    <CalcButton text="C" />
    <CalcButton text="AC" />
    <CalcButton text="%" />
    <CalcButton text="รท" />
    <CalcButton text="7" />
    <CalcButton text="8" />
    <CalcButton text="9" />
    <CalcButton text="X" />
    <CalcButton text="4" />
    <CalcButton text="5" />
    <CalcButton text="6" />
    <CalcButton text="-" />
    <CalcButton text="1" />
    <CalcButton text="2" />
    <CalcButton text="3" />
    <CalcButton text="+" />
    <CalcButton text="0" />
    <CalcButton text="," />
    <CalcButton text="=" />
  </div>
);


function App() {
  return (
    <div className="calc-container">
      <Calculator />
    </div>
  );
}

export default App;
